/* eslint-disable no-unused-vars */
class StorageProvider{constructor(){this.storage=null;}setStorage(t){return this.storage=t,this;}call(t,r,e){if("function"==typeof t[r])return t[r](...e);throw Error(`Provider ${t.constructor.name||"StorageProvider"} does not have method ${r}`);}set(t,r){return this.call(this.storage,"set",[t,r]);}update(t,r){return this.call(this.storage,"update",[t,r]);}get(t){return this.call(this.storage,"get",[t]);}list(){return this.call(this.storage,"list",[]);}remove(t){return this.call(this.storage,"remove",[t]);}}

